import { createOrder, fetchOrders } from "../../api";
import actionTypes from "../Constants/actionTypes";

export async function setOrders(orders) {
    try {
        const { data } = await fetchOrders();
        dispatch({ type: actionTypes.SET_ORDERS, payload: data });
    } catch (error) {
        console.log(error.message);
    }
}

export const create_order = (order, navigate) => async (dispatch) => {
    try {
        const { data } = await createOrder(order);
        dispatch({ type: actionTypes.CREATEORDER, payload: data });

        navigate(`/`);
    } catch (error) {
        console.log(error.message);
    }
};
